import React, {useState} from 'react'

import {
    Button,
    Table,
    TableContainer,
    Box,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    Container,
    MenuItem,
    Menu,
    TablePagination,
  

    
    
} from '@mui/material'
import MoreVertIcon from '@mui/icons-material/MoreVert'
import IconButton from '@mui/material/IconButton';
import FirstPageIcon from '@mui/icons-material/FirstPage';
import KeyboardArrowLeft from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRight from '@mui/icons-material/KeyboardArrowRight';
import LastPageIcon from '@mui/icons-material/LastPage';








const Import = (props) => {
    // fill out this component
    console.log(props)
// *pagination


const [page, setPage] = React.useState(0);
const [rowsPerPage, setRowsPerPage] = React.useState(10);


const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = event => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };
  const emptyRows =
    rowsPerPage - Math.min(rowsPerPage, rows.length - page * rowsPerPage);










    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    }
    const handleClose = () => {
        setAnchorEl(null);
      };
    const [deleteMakes] = useState(null);

    const handleDeletes = (index) => {
        props.deleteMakes(deleteMakes, index)
        setAnchorEl(null);
    }

    return (
      
        <Container>
              <br />
              <br />
        <Button
            variant="contained"
            color="primary"
            onClick={props.fetchMakes}>Import</Button>
            
            <h2> Count: {props.makes.length}</h2>

            <TableContainer>
            <Table>
            <TableHead>
                <TableRow>
                    <TableCell>Id</TableCell>
                    <TableCell>Make</TableCell>
                    <TableCell>Actions</TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
            {(rowsPerPage > 0
              ? props.makes.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              : props.makes
            ).map((makes, index) => (
          
                    <TableRow key={index}>
                        <TableCell>{makes.MakeId}</TableCell>
                        <TableCell>{makes.MakeName}</TableCell>
                        <TableCell>
                            <MoreVertIcon onClick={handleClick} />
                         
                            <Menu   
                                    id="basic-menu"
                                    anchorEl={anchorEl}
                                    keepMounted
                                    open={Boolean(anchorEl)}
                                    onClose={handleClose}
                                 
                                    
                                >
                                    <MenuItem onClick={handleDeletes}>Delete</MenuItem>
                                    <MenuItem onClick={handleClose}>Close</MenuItem>
                                </Menu>
                                                        
                         </TableCell>   
                    </TableRow>
                    
                    
            ))}

        {emptyRows > 0 && (
              <TableRow style={{ height: 53 * emptyRows }}>
                <TableCell colSpan={6} />
              </TableRow>
            )}
            </TableBody>
        </Table>
        </TableContainer>
        <br />
     {/* pagination */}
     
     <TablePagination
        rowsPerPageOptions={[5, 10, 25]}
        component="div"
        count={rows.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onChangePage={handleChangePage}
        onChangeRowsPerPage={handleChangeRowsPerPage}
      />
    








      
</Container>
        
    )
}

export default Import
